import React, { Component } from "react";
import BlogDataService from "../service/BlogDataService";

class ListBlogComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
            blogs: []
        }

        this.refreshTodo = this.refreshTodo.bind(this)

    }

    componentDidMount() {
        this.refreshTodo();
    }

    refreshTodo() {
        let username = AuthenticationService.getLoggedInUserName();

        BlogDataService.retrieveAllTodos(username)
            .then(res => {
                this.setState({
                    todos: res.data
                })
            })
    }

    render() {


        return (
            <div>
                Blog page
            </div>

        )
    }



}

export default ListBlogComponent;
